; Input: A = or numbers, DE string index, HL = number, BC = 10000,1000,100,10,1
; Output: Write number to memory
; Pollutes: AF, AF', HL, B, DE
NEXTNUMBER:
    ex   AF, AF'        ; 1:4
    xor   A             ; 1:4

    inc   A             ; 1:4
    sbc  HL, BC         ; 2:15
    jr   nc, $-3        ; 2:7/12
    
    add  HL, BC         ; 1:11
    dec   A             ; 1:4
    ld    B, A          ; 1:4    
    add   A, '0'        ; 2:7       0   
    ex   AF, AF'        ; 1:4
    
    or    B             ; 1:4
    ret   z             ; 1:5/11    zatim same nuly
    
    ex   AF, AF'        ; 1:4
    ld  (DE), A         ; 1:7
    inc  DE             ; 1:6
    ex   AF, AF'        ; 1:4
    ret                 ; 1:10

; Input: HL
; Output: Print decimal number in HL
; Pollutes: AF, AF', BC, delete top stack
PRINT_NUM:
    push DE             ; 1:11

    ld   DE, STRNUM     ; 3:10

    bit   7, H          ; 2:8
    jr    z, PRINT_NUM_P; 2:7/12
    
    ld    A, '-'        ; 2:7
    ld  (DE), A         ; 1:7
    inc  DE             ; 1:6

    ld    A, L          ; 1:4
    cpl                 ; 1:4
    ld    L, A          ; 1:4
    ld    A, H          ; 1:4
    cpl                 ; 1:4
    ld    H, A          ; 1:4
    inc  HL             ; 1:6
PRINT_NUM_P:
    
    xor   A             ; 1:4
    ld   BC, 10000      ; 3:10
    call NEXTNUMBER     ; 3:17
    
    ld   BC, 1000       ; 3:10
    call NEXTNUMBER     ; 3:17
    
    ld   BC, 100        ; 3:10
    call NEXTNUMBER     ; 3:17
    
    ld   BC, 10         ; 3:10
    call NEXTNUMBER     ; 3:17
    
    ld    A, '0'        ; 2:7
    add   A, L          ; 1:4
    ld  (DE), A         ; 1:7
    
    ex   DE, HL         ; 1:4
    
    inc  HL             ; 1:6
    ld  (HL), 0x20      ; 2:10      space after
    
    ld   DE, STRNUM     ; 3:10
    sbc  HL, DE         ; 2:15
    push HL             ; 1:11
            
    ld    L, 0x1A       ; 2:7       Upper screen
    call 0x1605         ; 3:17      Open channel
    
    pop  BC             ; 1:10      Length-1 of string to print
    ld   DE, STRNUM     ; 3:10      Address of string
    call 0x2040         ; 3:17      Print our string

    pop  HL             ; 1:10      last DE
    pop  BC             ; 1:10      ret
    pop  DE             ; 1:10
    push BC             ; 1:11      ret
    ret                 ; 1:10
STRNUM:
DB      "Dw0rkin"
